import actionNames from "./actionNames";

export const currencyChangeAction = (currencyName) => ({
    type: actionNames.CURRENCY_CHANGE,
    currencyName
});


export const filterActions = (filterName) => ({
    type: actionNames.FILTERS,
    filterName,
    completed: false
})
